script: |
  super -f text -I q1951.spq | sort > q1951.out

inputs:
  - name: q1951.spq
    data: |
      SELECT + col0 * - col0, + col1 * - - col0 + + col2 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE - col1 NOT IN ( - - col0 );
  - name: tab1

outputs:
  - name: q1951.out
    data: |
      -2601	810
      -7225	484
      -8281	4345
